  \"2013-03-14T19:23:50.464270\",\n\t\"name\": \"burrowing-owl-palo-verde-valley-ds197\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"These burrowing owl observations were collected
  during the spring and early summer of 1976 in the Palo Verde Valley, eastern Riverside
  County, California. This is an agricultural area along the Colorado River where
  irrigated alfalfa was a very common crop and was grown year-round. Water supply
  canals were common, often elevated, and with dirt berms and roads flanking them.
  This micro topographical feature was used extensively by burrowing owls for roosts
  and burrows. Surveys were not specifically planned, but the observer tried to drive
  various routes through the Palo Verde Valley when on the way to perform other work
  tasks. Almost 80% of the observations were made before 0900 or after 1500. Observations
  were visual and made by the driver looking for burrowing owls while the vehicle
  was moving. If a burrowing owl was seen it represented a site. This site was determined
  to be new or currently known by the presence of another burrowing owl(s) observed
  at the time of the observation or if one had been seen in the past, and by the distance
  between the current owls or the current owl observation and a previous observation.
  Observations were recorded on a tape recorder with the date and time, number of
  owls seen, presence of an easily observable burrow entrance, and the location using
  the distance and direction from road and canal junctions noted. Data was taken from
  the tape recorder and put on paper at intervals ranging from once a week to once
  a month.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"responsible-party\",\n\t\t\"value\":
